%[text] %[text:anchor:T_422d] # Exercise 4: Swingarm Optimization for Strength using MATLAB and `PythonOCC`
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:H_70a5] **Introduction**
%[text] Manual changes of the geometry and reevaluation of the strength for the given load cases can be quite tedious. Therefore, it is recommended to use established optimization routines such that the ones provided by the [Optimization Toolbox](https://www.mathworks.com/products/optimization.html)™ and the [Global Optimization Toolbox](https://www.mathworks.com/products/global-optimization.html)™. In this exercise you will learn how to define an appropriate cost function, define an appropriate constraint for the well-posedeness of the optimization problem at hand, and use the [Optimize Live Task](https://www.mathworks.com/help/matlab/math/optimize-live-editor-matlab.html) in MATLAB to perform optimization of the motorcycle swingarm for strength. 
%[text] <u>**To interact with this Exercise: **</u>
%[text] **Whenever you see the icon **![Try this icon](text:image:1e70), \*\*this will indicate the specific steps you should take to complete the section of the exercise. \*\*Also, instead of executing the whole script, run each section separately (see below) or using the keyboard shortcut (`Ctrl+Enter`): 
%[text]  ![Run Section.png](text:image:7527) 
%%
%[text] %[text:anchor:H_57bc] ## 1) Setup `PythonOCC` environment
%[text] **Instructions**
%[text] In this first step, you will load the python environment that contains all needed functions to use PythonOCC from MATLAB. If this is the first time you run this section, the installation of `PythonOCC` may take up to approximately one minute. Otherwise, it will take just a few seconds to create the new geometry representation used in the exercise. 
%[text] **Load the ****`PythonOCC`** environment and install custom functions
clear, geometryFunctions = env_conf(true); %[output:14aa75b4]
%[text] %[text:anchor:H_5c6a] **Setup geometry ****`PythonOCC`** object
fileName = fullfile(".", "geometry", "swingarm brep.igs");
geometryObj = geometryFunctions.MyApp();
geometryObj.readGeometryFile(fileName)
%[text] ![Try this icon](text:image:9791) <u>Run this section of code by using "Run Section" in the toolstrip or clicking the "Run Code Section" button below:</u>
  %[control:button:16e7]{"position":[1,2]}
%%
%[text] %[text:anchor:H_092d] ## 2) Select Edge for Update
%[text] Using `PythonOCC `you can select any edges or control points to start modifying the geometry. To limit choices during this workshop, you will have a subset of 3 edges to choose from. Use the dropdown list in the code below to select the edge of the geometry you would like to update (use the screenshots below as reference for the three different edges that can be modified) 
%[text] ![edges_ex3_ex4.png](text:image:8e1a)
%[text] 
%[text] ![Try this icon](text:image:6378) <u>Select an element from the dropdown list below. Note this Section will run automatically once you make a selection.</u>
edgeID = 34; %[control:dropdown:3333]{"position":[10,12]} %[text:anchor:M_M_1426]
geometryObj.selectedEdges = py.list([]);
selectedEdge = getSelectedEdge(geometryObj.baseShape, edgeID);
geometryObj.selectedEdges.append(selectedEdge)
geometryObj.getDataDesignVariables(py.int(0))
geometryObj.computeNumDesignVariables()
displaySelection(edgeID)
%%
%[text] %[text:anchor:H_004d] ## 3) Select an Initial Guess for the Design Update
%[text] **Instructions**
%[text] %[text:anchor:H_3241] 1. Please choose a value between -100 and 100 for the [edit field here](internal:M_4413) (the units are cm)
%[text] 2. This value will be used as a starting point for the optimization algorithm in Section [4.) Perform Swingarm Optimization](internal:H_28f1) and it plays a crucial role in the optimization process \
%[text] (This Code Section will run automatically once you move the value of [this edit field](internal:M_4413) has been entered)
%[text] ![Try this icon](text:image:2f02) <u>Choose a value between -100 and 100 for </u><u>`d0`</u><u> (the units are cm). Note this Section will run automatically once you make a selection.</u>
d0 = 0; % [cm] %[control:editfield:2349]{"position":[6,7]} %[text:anchor:M_M_4413]
if d0 < -100 || d0 > 100
    error("Please select a value for the initial guess of the design update between -100 and 100. You chose %d", d0)
end
%[text] Inline definition of the cost and the nonlinear constraint function
STEPFileName = fullfile(".", "metadata", "swingarm brep updated.step");
myComputeStrainEnergy = @(d) computeStrainEnergy(d, geometryFunctions, geometryObj, STEPFileName, true);
myAngleConstraint = @(d) computeAngleConstraint(d, geometryObj);
%%
%[text] %[text:anchor:H_0ffc] ## 4) Perform Swingarm Optimization
%[text] ![Try this icon](text:image:70f2) **Instructions**
%[text] 1. Note that the initial guess selected in Section [3.) Select an Initial Guess for the Design Update](internal:H_33f4) is used in the [Optimize Live Task](internal:M_141b) below: ![initial point.png](text:image:2f7a)
%[text] 2. The [Optimization Toolbox™](https://www.mathworks.com/products/optimization.html) and the [Global Optimization Toolbox™](https://www.mathworks.com/products/global-optimization.html) offer a plethora of functions that can be used for optimization. This problem involves a nonlinear cost function with a nonlinear constraint. The cost function is the strain energy which is sought to be minimized for a stronger design: ![cost function.png](text:image:074d). The assumed nonlinear constraint herein is, that the angle of the faces adjacent to the selected edges must not become negative: ![angle constraint.png](text:image:49d6). This makes sense because we do not want our final design to have a sharp kink in any of the optimized corners! For this problem, please use the already selected Patter Search algorithm for the optimization, see ![patternsearch.png](text:image:86e5)
%[text] 3. Run this Code Section by clicking the "Run" button below. Observe how the design changes throughout the iterations in the output section right under the [Optimize Live Task](internal:M_141b). Let the optimizer conclude and play the automatically generated animation showing how the design changes through the optimization iterations \
  %[control:button:7583]{"position":[1,2]} %[text:anchor:M_M_141b]
% Set nondefault solver options %[task:2df3]
options = optimoptions("patternsearch","MaxIterations",2,"MaxTime",60);

% Solve
[solution,objectiveValue] = patternsearch(myComputeStrainEnergy,d0,[],[],[],...
    [],zeros(size(d0)),[],myAngleConstraint,options);

% Clear variables
clearvars options %[task:2df3]
%[text] - If you want to know more about how the cost function is formulated, please navigate to auxiliary function [**`computeStrainEnergy.mlx`**](<file:./auxiliary functions/computeStrainEnergy.mlx:T_63cb>)
%[text] - If you want to know more about how the constraint function is formulated, please navigate to auxiliary function [**`computeAngleConstraint.mlx`**](<file:./auxiliary functions/computeAngleConstraint.mlx:T_5803>) \
%%
%[text] %[text:anchor:H_9503] ## 5) Assess the Optimization Results
%[text] ![Try this icon](text:image:33c9) **Instructions**
%[text] 1. Please make sure that the optimization from Section [4.) Perform Swingarm Optimization](internal:H_0ab2) has concluded and that variable `solution` exists in the workspace
%[text] 2. Run this Code Section using the "Run" button below
%[text] 3. Rotate the embedded figure and observe the optimal swingarm design achieved by the optimizer. What is your observation?
%[text] 4. Observe the strain energy for the optimal swingarm design achieved by the optimizer displayed [here](internal:M_5bc8). How does this compare to the value strain energy for the original model [here](file:./main_Exercise2.mlx:M_5f87)? Why?
%[text] 5. What can you say about the angle between the adjacent faces of the selected edge displayed [here](internal:M_90d7) (in degrees °)? What do you think was the original angle between the adjacent to the selected edge faces? \
  %[control:button:3a7e]{"position":[1,2]}
%[text] **Visualize the updated design**
geometryObj.updateShape(py.list(num2cell(solution)));
gm = importGeometry(STEPFileName);
pdegplot(gm, EdgeLabels="off", FaceLabels="off", FaceAlpha=0.5)
%[text] **Compute the strain energy at the optimal design**
geometryObj.updateShape(py.list(num2cell(solution))) %[text:anchor:M_M_5bc8]
pyTuple = geometryFunctions.createSolidFromBRepCompound(geometryObj.updatedShape);
geometryFunctions.writeGeometryToFile(STEPFileName, pyTuple{1})
strainEnergy = computeStrainEnergy(solution, geometryFunctions, geometryObj, STEPFileName, false);
disp("The strain energy at the optimal swingarm design is equal to: " + strainEnergy)
%[text] **Compute the angle between the adjacent to the selected edge faces at the optimal design**
theta = computeAngleConstraint(solution, geometryObj);
disp("The angle between the adjacent to the selected edge faces at the optimal design is equal to: " + theta)

%%
